<!doctype html>
<html>

<head>
    <meta charset="utf-8">
    <meta name="viewport"
        content="width=device-width, viewport-fit=cover, initial-scale=1.0, user-scalable=no, maximum-scale=1.0, minimum-scale=1.0">
    <meta name="robots" content="noindex,nofollow" />
    <title>欢迎访问青山云！</title>
    <style>
        html,
        body {
            width: 100vw;
            height: 100vh;
        }

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        #childIframe {
            width: 100%;
            height: 100vh;
            border: none;
        }

        .loading_container {
            position: absolute;
            top: 40%;
            left: 40%;
            margin-left: 10%;
            transform: translate3d(-50%, -50%, 0);
        }

        .loading_container .dot {
            width: 24px;
            height: 24px;
            background: #3ac;
            border-radius: 100%;
            display: inline-block;
            animation: slide 1s infinite;
        }

        .loading_container .dot:nth-child(1) {
            animation-delay: 0.1s;
            background: #32aacc;
        }

        .loading_container .dot:nth-child(2) {
            animation-delay: 0.2s;
            background: #64aacc;
        }

        .loading_container .dot:nth-child(3) {
            animation-delay: 0.3s;
            background: #96aacc;
        }

        .loading_container .dot:nth-child(4) {
            animation-delay: 0.4s;
            background: #c8aacc;
        }

        .loading_container .dot:nth-child(5) {
            animation-delay: 0.5s;
            background: #faaacc;
        }

        @-moz-keyframes slide {
            0% {
                transform: scale(1);
            }

            50% {
                opacity: 0.3;
                transform: scale(2);
            }

            100% {
                transform: scale(1);
            }
        }

        @-webkit-keyframes slide {
            0% {
                transform: scale(1);
            }

            50% {
                opacity: 0.3;
                transform: scale(2);
            }

            100% {
                transform: scale(1);
            }
        }

        @-o-keyframes slide {
            0% {
                transform: scale(1);
            }

            50% {
                opacity: 0.3;
                transform: scale(2);
            }

            100% {
                transform: scale(1);
            }
        }

        @keyframes slide {
            0% {
                transform: scale(1);
            }

            50% {
                opacity: 0.3;
                transform: scale(2);
            }

            100% {
                transform: scale(1);
            }
        }
    </style>
</head>
